import React from 'react';
import Data from './Data';
import Data_Admin from './Data_Admin';

const App = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Data</Link>
            </li>
            <li>
              <Link to="/data_admin">Data Admin</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/data_admin">
            <Data_Admin />
          </Route>
          <Route path="/">
            <Data />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default App;
